import './css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>Tentativa de form 2.0</h1>
        </header>
        <form>
          <input type={'email'}></input>
        </form>
        <footer className="App-footer">
          <h3>Lucas Ferreira Monteiro - Turma 21 - Tribo A</h3>
        </footer>
      </div>
    );
  }
}

export default App;
